import React, {Component} from 'react';
import './LandingPage.css';

class Landing extends Component{
    rnder(){
        return(
            <div>
                <img src="https://images.unsplash.com/photo-1523828446771-151afb8374f1?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=ba89d19a6a959a20988982cfcd44fc3e&auto=format&fit=crop&w=564&q=80" id="mainImage" />
            

            </div>
        )
    }
}
export default Landing;
